Guid currentAgreementId = Get<Guid>("CurrentAgreementId");
if (currentAgreementId != Guid.Empty) {
	var esqAgreement = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "NavAgreement");
    esqAgreement.AddAllSchemaColumns();
    var agreement = esqAgreement.GetEntity(UserConnection, currentAgreementId);
	
	var creditProgramId =  agreement.GetColumnValue("NavCreditId");
	
	if(creditProgramId != null)
	{
		var esqInv = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "NavInvoice");
		esqInv.AddAllSchemaColumns();
		var esqFilterByAgreement = esqInv.CreateFilterWithParameters(FilterComparisonType.Equal, "NavAgreement", currentAgreementId);
		var esqFilterByInvoiceType = esqInv.CreateFilterWithParameters(FilterComparisonType.Equal, "NavInvoiceType", new Guid("1C038CB2-3B91-4F07-855E-67722210809B"));
		esqInv.Filters.Add(esqFilterByAgreement);
		var invoices = esqInv.GetEntityCollection(UserConnection);
		if (invoices.Count != 0)
		{
			foreach(var invoice in invoices)
			{
				var esqResult = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "NavInvoice");
				esqResult.AddAllSchemaColumns();
				var invoiceEntity = esqResult.GetEntity(UserConnection, invoice.GetTypedColumnValue<Guid>("Id"));
				invoiceEntity.Delete();
			}
		}
		var creditDue = agreement.GetTypedColumnValue<int>("NavCreditPeriod"); //срок кредита
		var creditAmount = agreement.GetTypedColumnValue<decimal>("NavCreditAmount"); //сумма кредита		
		DateTime startDate = agreement.GetTypedColumnValue<DateTime>("NavDate");
		
		creditDue = creditDue * 12;
		if(creditDue != 0)
		{
			creditAmount = creditAmount / creditDue;
			if(creditAmount !=0)
			{
				for(int i = 0; i < creditDue; i++)
				{
					EntitySchema invoiceSchema = UserConnection.EntitySchemaManager.GetInstanceByName("NavInvoice");
					Entity invoiceEntity = invoiceSchema.CreateEntity(UserConnection);
					invoiceEntity.SetDefColumnValues();
					invoiceEntity.SetColumnValue("NavAgreementId", currentAgreementId);
					invoiceEntity.SetColumnValue("NavAmount", creditAmount);
					invoiceEntity.SetColumnValue("NavDate", startDate);
					invoiceEntity.SetColumnValue("NavInvoiceTypeId", new Guid("1C038CB2-3B91-4F07-855E-67722210809B"));
					invoiceEntity.SetColumnValue("NavName", $"Счет № {i} {agreement.GetColumnValue("NavName")}");
					invoiceEntity.SetColumnValue("NavPayDate", DateTime.Now);
					invoiceEntity.Save();
					startDate = startDate.AddMonths(1);
				}
				agreement.SetColumnValue("NavPaymentPlanDate", DateTime.Now.AddDays(1));
				agreement.Save();
			}
		}
	}
}
return true;
